const Login = () => {
    return (
        <div>
            <form>
                <div className="form-group">
                    <input type="text" name="username" placeholder="Username"/>
                </div>
                <div className="form-group">
                    <input type="password" name="password" placeholder="Password"/>
                </div>
                <div className="form-group">
                    <button type="submit">submit</button>
                </div>
            </form>
        </div>
    )
};

export default Login;
